Plantilia:Pakdaar ti panagurnos karga/bugas/pagipadasan Daytoy ket isu ti subplantilia nga {{pakdaar ti panagurnos karga/bugas}}. Saan a naikari a dagus nga usaren daytoy a plantilia, embes ket nga usaren ti {{pakdaar ti panagurnos karga}}. Daytoy a plantilia ket tinawtawagan manipud iti {{pakdaar ti panagurnos karga}}. Daytoy ket agtengngel kadagiti paset ti kodigo para iti {{pakdaar ti panagurnos karga}}, bayat a ti {{pakdaar ti panagurnos karga}} ket isu ti mangpreproseso ti parametro. Ken is
..........
Dagiti teknikal a salaysay[urnosen ti taudan] Daytoy a subplantilia ket agtengngel ti panangikarga dagiti pakdaar ti grupo ken panid, ken dagiti silpo kaniada. Daytoy a plantilia ket agdama a mangnamnama kadagitoy a parametro: {{pakdaar ti panagurnos karga/bugas | notice action = {{{notice action|}}}   | group allowed = {{adda dagiti subpanid ti ns}}   | groupnotice =   | pagenotice =   | userpage =   | ownuserpage =   }} Para iti adu pay a dokumentasion kitaen ti {{pakdaar ti panagurnos karga}}
